import React from 'react';
import HeaderTemplate from '../common/HeaderTemplate';
import MyPageTemplate from '../Components/MyPageTemplate';
import MyPageForm from '../Components/MyPageForm';

const MyPage = () => {
    return(
        <>
            <HeaderTemplate />
            <MyPageTemplate />
        </>
    );
};

export default MyPage;
